CREATE TABLE "CLASSICMODELS"."CUSTOMERS"
(
   CUSTOMERNUMBER int PRIMARY KEY NOT NULL,
   CUSTOMERNAME varchar(50),
   CONTACTLASTNAME varchar(50),
   CONTACTFIRSTNAME varchar(50),
   PHONE varchar(50),
   ADDRESSLINE1 varchar(50),
   ADDRESSLINE2 varchar(50),
   CITY varchar(50),
   STATE varchar(50),
   POSTALCODE varchar(15),
   COUNTRY varchar(50),
   SALESREPEMPLOYEENUMBER int,
   CREDITLIMIT float(52)
)
;
CREATE TABLE "CLASSICMODELS"."EMPLOYEES"
(
   EMPLOYEENUMBER int PRIMARY KEY NOT NULL,
   LASTNAME varchar(50),
   FIRSTNAME varchar(50),
   EXTENSION varchar(10),
   EMAIL varchar(100),
   OFFICECODE varchar(10),
   REPORTSTO int,
   JOBTITLE varchar(50)
)
;
CREATE TABLE "CLASSICMODELS"."OFFICES"
(
   OFFICECODE varchar(10) PRIMARY KEY NOT NULL,
   CITY varchar(50),
   PHONE varchar(50),
   ADDRESSLINE1 varchar(50),
   ADDRESSLINE2 varchar(50),
   STATE varchar(50),
   COUNTRY varchar(50),
   POSTALCODE varchar(15),
   TERRITORY varchar(10)
)
;
CREATE TABLE "CLASSICMODELS"."ORDERDETAILS"
(
   ORDERNUMBER int NOT NULL,
   PRODUCTCODE varchar(15) NOT NULL,
   QUANTITYORDERED int,
   PRICEEACH float(52),
   ORDERLINENUMBER smallint,
   CONSTRAINT SQL130819205754310 PRIMARY KEY (ORDERNUMBER,PRODUCTCODE)
)
;
CREATE TABLE "CLASSICMODELS"."ORDERS"
(
   ORDERNUMBER int PRIMARY KEY NOT NULL,
   ORDERDATE date,
   REQUIREDDATE date,
   SHIPPEDDATE date,
   STATUS varchar(15),
   COMMENTS long varchar,
   CUSTOMERNUMBER int
)
;
CREATE TABLE "CLASSICMODELS"."PAYMENTS"
(
   CUSTOMERNUMBER int NOT NULL,
   CHECKNUMBER varchar(50) NOT NULL,
   PAYMENTDATE date,
   AMOUNT float(52),
   CONSTRAINT SQL130819210405400 PRIMARY KEY (CUSTOMERNUMBER,CHECKNUMBER)
)
;
CREATE TABLE "CLASSICMODELS"."PRODUCTLINES"
(
   PRODUCTLINE varchar(50) PRIMARY KEY NOT NULL,
   TEXTDESCRIPTION varchar(4000),
   HTMLDESCRIPTION clob(1073741823),
   IMAGE blob(1073741823)
)
;
CREATE TABLE "CLASSICMODELS"."PRODUCTS"
(
   PRODUCTCODE varchar(15) PRIMARY KEY NOT NULL,
   PRODUCTNAME varchar(70),
   PRODUCTLINE varchar(50),
   PRODUCTSCALE varchar(10),
   PRODUCTVENDOR varchar(50),
   PRODUCTDESCRIPTION long varchar,
   QUANTITYINSTOCK int,
   BUYPRICE float(52),
   MSRP float(52)
)
;
